MongoDb query to java code using aggregates<p>Can someone help me converting the below query to java code?</p>

<p>I have written the following query in java as below but am getting below error, </p>

<p><strong>Command failed with error 168: 'Unrecognized expression '$push'' on server. The full response is { "ok" : 0.0, "errmsg" : "Unrecognized expression '$push'", "code" : 168, "codeName" : "InvalidPipelineOperator" }</strong></p>

<p>Query:</p>

<pre><code>db.getCollection('xyz').aggregate([
             {$match: { "_id":{$in: [{"a" : "NA","b" : "HXYZ","c" : "12345","d" : "CA"}]}
                     }
                   },
              { $unwind: '$bal' },
              {
                 $sort: {'bal.date': -1}
              },
              {$group:
                   {"_id": "$_id",bal:{$push:'$bal'}}},
               { $project: {
            balances: { $slice: ["$bal",2]} 
                            }
               }

       ])
</code></pre>

<p>Java Code:</p>

<pre><code>List&lt;Document&gt; findDocument=collectionName.aggregate(
            Arrays.asList(
                Aggregates.match(in("_id",tempList)),
            Aggregates.unwind("$bal"),
            Aggregates.sort(Sorts.descending("bal.date")),
            Aggregates.group(new Document("_id","$_id").append("bal",new Document("$push","$bal"))),
        Aggregates.project(new Document("bal",new Document ("$slice",Arrays.asList("$bal", 2)))))).into(new ArrayList&lt;Document&gt;());
</code></pre>

<p>The Mongo DB version is 3.4.
Can someone tell me why is $push not working ?
Thanks in advance.</p>

