Symfony - Mongodb - sum and group by<p>I suppose we have this data</p>
<pre><code>{ &quot;_id&quot; : 1, &quot;item&quot; : &quot;abc&quot;, &quot;quantity&quot; : 2, &quot;category&quot; : 1}

{ &quot;_id&quot; : 2, &quot;item&quot; : &quot;jkl&quot;, &quot;quantity&quot; : 1, &quot;category&quot; : 1}

{ &quot;_id&quot; : 3, &quot;item&quot; : &quot;xyz&quot;, &quot;quantity&quot; : 5, &quot;category&quot; : 2}

{ &quot;_id&quot; : 4, &quot;item&quot; : &quot;abc&quot;, &quot;quantity&quot; : 10, &quot;category&quot; : 2}

{ &quot;_id&quot; : 5, &quot;item&quot; : &quot;xyz&quot;, &quot;quantity&quot; : 10, &quot;category&quot; : 3}

{ &quot;_id&quot; : 6, &quot;item&quot; : &quot;cds&quot;, &quot;quantity&quot; : 9, &quot;category&quot; : 3}
</code></pre>
<p>I want to make a query that give me the category that contain the biggest quantity. so I have to:</p>
<p>1- Group by category</p>
<p>2- Make the sum of quantities of items in each category</p>
<p>3- Get the highest value among those sums.</p>
<p>So in Mongodb I got a little help <a href="https://stackoverflow.com/questions/51712507/mongodb-get-highest-value-of-a-sum-groupped-by-a-field">here</a> :</p>
<pre><code>db.items.aggregate([
  { $match: {} },
  { $group: {
         _id: '$category',
         sumQ: {$sum: '$quantity'}
      } 
  },
  { $sort: {sumQ: -1 } },
  { $limit: 1 }
])
</code></pre>
<p>But when I want to convert that with the<br />
<code>createAggregationBuilder</code><br />
I couldn't find how to do that.</p>

