How to populate nested entity in Mongoose?<p>I have such models:</p>

<pre><code>const UserSchema = new mongoose.Schema({
  name: String,
  workspaces: [
    {
      workspace: {
        type: mongoose.Schema.ObjectId,
      },
      owner: Boolean
    }
  ]
});

const WorkspaceSchema = new mongoose.Schema({
  title: String,
  description: String 
});
</code></pre>

<p>I want to populate the User record like this:</p>

<pre><code>{
  name: "John",
  workspaces: [{
    workspace: {
      title: "First space",
      description: "About space#1"
    },
    owner: true
  }, {
    workspace: {
      title: "Second space",
      description: "About space#2"
    },
    owner: false
  }]
}
</code></pre>

<p>I tried to do this via populate method:</p>

<pre><code>const user = await User
  .findOne(query)
  .populate({
    path: 'workspaces',
    populate: {
      path: 'workspace',
      model: 'Workspace'
    }
  });
</code></pre>

<p>And it's not correct. I searched for case like this, but didn't find anything similar. All another examples doesn't includes property like my boolean "owner".</p>

