Pyramid / mongo : building a nested tal:repeat for a EmbeddedDocumentListField<p>i'm building a little app and testing at the same time Pyramid/Chameleon + MongoDB
So far, I LOVE it but I've encountered a dead end</p>

<p>Quick look a the data I want to display from a category collection</p>

<pre><code>_id:"category"
themes:Array
  0:Object
    _id:"theme1"
  1:Object
    _id:"theme2"
  2:Object
    _id:"theme3"
user:"username"
</code></pre>

<p>Themes are an EmbeddedDocumentListField in mongoengine (but for this I only need the id)</p>

<p>I worked out how to tal:repeat my categories with</p>

<p><em>pt file</em></p>

<pre><code>&lt;div class = "category" tal:repeat="c categories"&gt;
  &lt;h2&gt;${c.id}&lt;/h2&gt;
&lt;/div&gt;
</code></pre>

<p><em>viewmodel</em></p>

<pre><code>self.categories = get_category_for_user(user)
</code></pre>

<p>What I want now is to nest tal:repeat to display a result like this</p>

<pre><code>&lt;div class = "category" tal:repeat="c categories"&gt;
  &lt;h2&gt;${c.id}&lt;/h2&gt;
  &lt;div class="theme" tal:repeat="t themes"&gt;
    &lt;div class="title"&gt;
      &lt;a href="/theme/${t.id}"&gt;${t.id}&lt;/a&gt;&lt;/div&gt;
    &lt;/div&gt;
  &lt;/div&gt;
&lt;/div&gt;
</code></pre>

<p>The thing is to get themes, i need the category, and I haven't figured how to extract the category used in the loop to the viewmodel. Is there any way to pass variables from the pt to the viewmodel py file? Something like <em>tal:repeat t themes(${c.id})</em> ?
Or am I doing this completly wrong and there is a simple way to do that?</p>

