merge aggregation and find results in MongoDB<p>I have this model: </p>

<pre><code>const recordSchema = new Schema({
  user: {
    type: Schema.ObjectId,
    ref: 'Person',
    required: true
  },
  date: {
    type: Date,
    default: Date.now()
  },
  time: {
    type: Date,
    default: Date.now()
  }
});
</code></pre>

<p>So, when I make a HTTP Get request I receive an array of records: </p>

<p><code>[{/*record1*/}, {/*record2*/}, ...]</code></p>

<p>The point is that I'm using aggregation to get the number of records of each user (I got that cover), but I would like merge this with the find results to receive something like this:</p>

<pre><code>{
  "records": [{/*record1*/}, {/*record2*/}, ...],
  "stats": [
    { 
      "_id" : ObjectId("5b6393f2a1d3de31d9547f63"),
      "count" : 3.0
    },
    { 
      "_id" : ObjectId("5b5d22d8b6195d1b6a5d2574"),
      "count" : 17.0
    }
  ]
}
</code></pre>

<p>So, how do I get this?</p>

<p><strong>Note</strong>: I'm using this for data for some charts, should I handle this on node or on the front-end?</p>

