mongoose: .find() is not a function<p>None of the already existing posts on Stackoverflow have remedied my issue. I have the following in the router:</p>

<pre><code>const express = require("express");
const mongoose = require("mongoose");
const User = require("./users/models");
const app = express();
const router = express.Router();
mongoose.Promise = global.Promise;

app.use(express.json());

router.post("/add", (req, res) =&gt; {
    const username = req.body.username;
    console.log(username);
    User.find({ username: username })
        .then(user =&gt; res.json(user.serialize()))
        .then(res =&gt; console.log(res));
});

module.exports = router;
</code></pre>

<p>with the following Schema:</p>

<pre><code>const UserSchema = mongoose.Schema({
  username: {
    type: String,
    required: true,
    unique: true,
  },
  password: {
    type: String,
    required: true,
  },
  firstName: { type: String, default: "" },
  lastName: { type: String, default: "" },
  bases: [{ type: mongoose.Schema.Types.ObjectId, ref: "UserVariables" }],
});

const UserVariables = mongoose.Schema({
  bases: { type: "String", required: true },
  users: [{ type: String }],
});
const UserVariable = mongoose.model("UserVariable", UserVariables);
const User = mongoose.model("User", UserSchema);

module.exports = { User, UserVariable };
</code></pre>

<p>When running the server, the .find() method returns an error message stating: <code>TypeError: User.find is not a function</code>. I tried several different versions in the router:</p>

<pre><code>router.post("/add", (req, res) =&gt; {
    const username = req.body.username;
    User.find({ username: username }, user =&gt; {
        console.log(user);
    });
</code></pre>

<p>as well as: </p>

<pre><code>User.findOne({ username: username })
        .then(user =&gt; res.json(user.serialize()))
        .then(res =&gt; console.log(res));
});
</code></pre>

<p>Neither of which works. In another App i am running the former and it works just fine. Any ideas ?</p>

